import { useEffect, useState} from 'react';
import { getData } from './peticiones/personas'


function App() {

  const [data, setData] = useState([])

  useEffect(() => {                          
     setData(getData());
     console.log(data)
  }, []);

  return (
    <h1>Hola</h1>
  );
}

export default App;
